script: |
  super -f text -I q350.spq | sort > q350.out

inputs:
  - name: q350.spq
    data: |
      SELECT DISTINCT + + 46 + cor0.col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q350.out
    data: |
      56
      59
      72
